import styled from 'styled-components';

const Wrapper = styled.section`
  margin: 0 auto;
  max-width: var(--max-width-content);

  .bigcard_box {
    display: flex;
    align-items: center;
    gap: 4.3rem;
    background: #000;
    height: 50rem;

    .bigcard_box_left {
      p {
        color: #00ff66;
        font-size: 16px;
        font-weight: 600;
      }

      h2 {
        font-size: 48px;
        font-weight: 600;
        color: #fafafa;
      }
    }
    span {
      color: red;
    }
  }
`;
export default Wrapper;
